import 'package:ieca_mobile/_import.dart';

class CoHymnsTuanuke {
  static List<HymnsContent> list = [
    HymnsContent(id: 3742, position: 1, content: "Yesu kanangufwila,\nChe chikuma chipema,\nAna eswe wafwila,\nNi akepe maakolesa.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3743, content: "Mba wangufwila!\nMba wangufwila!\nMba wangufwila!\nLie Liji lia Mwene.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_44, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3744, position: 2, content: "Wanguzanga, wafwile,\nLilu angwazulwile;\nKumanguchiza shili,\nHanga ngunjile nenyi.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3745, position: 3, content: "Yesu kumangukwasa\nMuze mungwivwa lamba,\nYesu kwilu, kakwiza,\nMukungulembejeka.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3746, position: 4, content: "Wangufwila, twakwenda\nHamuwika mu jila,\nNdo mwilu mangutwala,\nKachi mungumukaula.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3747, position: 5, content: "Chilamwina, tambula\nMbunge yami ya yena,\nYena wangufwilile,\nHanga ngukapwe mwané.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_44, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3748, position: 1, content: "Umwe chimwangi \nWayile kusuku\nNgwenyi, Ngufupe \nUpeme wa hashi.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3749, content: "Hiluka, hiluka, \nKanda ushimbula,\nZambi matambula \nYena chimwangi.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_45, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3750, position: 2, content: "Mbongo ni yuma \nWamwangine nwamwa\nNdako ya shili \nWakawile pundu.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3751, position: 3, content: "Homa ha ngulu \nWafupile kulia\nHaze wanyongene \nKuli tato.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3752, position: 4, content: "Ngwenyi, Mala! \nNgunapiasuka chinji,\nChocho milonga \nYalumbama naye.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3753, position: 5, content: "Ngwenyi Nguhiluke \nKuli akwetu,\nNgukalipwise \nKapinji ka tata.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3754, position: 6, content: "Muze tato \nWamumwene kaneza\nWamutambwile \nKanawa kanawa.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_45, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3755, position: 1, content: "Ivwenu akwetu, sango lietu,\nKu kufwa twatwamine.\nWejile umwe, Mukwa uhenya,\nMukutufwila eswe.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3756, content: "Iya watulamwinyine?\n- Yesu K’Listu Iye Mwene.\nNgwe kuchi mba?\n- Watufwila.\nKulihi ali?\n- Chamwenemwene\nMwilu nikuhakwila.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_46, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3757, position: 2, content: "Angelo kenu atusele,\nChipwe yoze walutwe.\nHa kulusu mwe Mwana Zambi\nHali yetu wafwile.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3758, position: 3, content: "Mutá kuli mwe Chilamwina,\nNikushikisa yeswe?\nUtambule ukonekeno\nNi kuhwima cha mbunge.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_46, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3759, position: 1, content: "Ha kunyonga kufwa cha Yesu\nChize amwene há kulusu;\nChakoka kulilelesa,\nKulichichimieka kenu.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3760, position: 2, content: "Ni chize mungulisamba,\nKufwa cha K’Listu, Zambi yami;\nYilelu yangupemena,\nMungwecha ku manyinga jenyi.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3761, position: 3, content: "Ku mutwe, moko ni molu,\nA kumusulumiokena,\nMujimba ngenu, chipupu,\nCha vumbi, chinge ni lamba.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3762, position: 4, content: "Ya hashi yeswe kachi te\nYa yami, ya kulambula,\nMulambu hindu ukepe,\nKuuchi kamuhashila.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3763, position: 5, content: "Kuzanga chenyi chinene,\nChangutamba kulisela\nNi mbunge ni mwono weswe,\nKapinji kenyi wa miaka.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_47, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3764, position: 1, content: "Yenu akwetu, tweyenu\nKuli Mwene Yesu;\nFulielenu lie Sango,\nLie lia Mwene wetu.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3765, content: "Tweyenu, tweyenu,\nKuli Mwene Yesu;\nFulielenu ni mbunge\nKuli Mwene Yesu.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_48, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3766, position: 2, content: "Yesu watufwilile,\nMukutulamwina\nKu shili ni satana,\nLamba ni utenu", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3767, position: 3, content: "Mwene makawahisa\nMweswe matayiza,\nNyi mbunge makunjika,\nKuli Chilamwina.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3768, position: 4, content: "Yesu kakulamwina,\nAkwa shili wika,\nKu milonga ya mbunge\nMwene maatomesa.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_48, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3769, position: 1, content: "Mwene, ngunakuwayila,\nSe wangufwilile;\nMu mbunge yami nanyonga\nLamba lia Kavwale.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_49, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3770, content: "Ngwiwuluke Ngesemane,\nLuyinda ungunyongese,\nNgwiwuluke kuzanga che\nKuze ku kavwale.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_49, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3771, position: 2, content: "Nakkutala ku fuka lie,\nKushimo haliapwa;\nNgusenye, ngukulambule.\nSe vumbi lia Yena.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_49, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3772, position: 3, content: "Ngupwe ni mbunge yipema,\nYa kukaula pundu,\nChipwe manguhungumiona,\nMunguwaha hindu.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_49, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3773, position: 4, content: "Mwene, kuzanga cha yena\nChikangushinjeke,\nKutwala ni kwambujola\nLiji lia kavwale.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_49, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3774, position: 1, content: "Usele ye ola, shimwinya kanji,\nUtwame ni Yesu, ukalie liji;\nLikate ni ana a Zambi eswe,\nUfupe uwape kuli Mwene we.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3775, position: 2, content: "Usele ye ola, mbila ya hashi;\nUshimbule shimbu kumeso jenyi;\nMba nikimutala mulifwa nenyi,\nAkwenu mamona kulifwa chenyi.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3776, position: 3, content: "Usele ye ola, akusongwele,\nAkutetekele matangwa eswe;\nKuwaha muwivwa ni lamba lieswe,\nHindu yekele, umufuliela.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3777, position: 4, content: "Usele ye ola, uhwime mbunge,\nAkakwononwese ku shimbi jeswe;\nKu fuji lia zango makutwalako,\nMukatela pundu milimo mwilu.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_50, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3778, position: 1, content: "Yesu wapombele mu fuka lienyi,\nMachitata tangwa ahinduke.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_51, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3779, content: "Mwene wahindukile,\nNikukumba akwa kole eswe.\nWahwishile tachi ja milima pwi\nMu lie pangu Mwene wanjililile\nNi mwono; kanasambe!\nKristu washindukile!", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_51, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3780, position: 2, content: "Lie fuka afungile chamokomoko,\nYinyingi ha liwe, ya uhuka wo.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_51, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3781, position: 3, content: "Kufwa chahonene kuzuka Mwene,\nJila Mwene wami wapulile.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_51, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3782, position: 1, content: "Mu wenyi kwenda ndo ha milundu,\nNi mu mihwahwa, hindu pangu;\nKlistu mayaya hamwe ni yami,\nNguli ni yenu, ngwenyi Yesu.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_52, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3783, content: "Uhenya kwilu, uhenya kwilu,\nZalisa mbunge yami, Mwane;\nAleluya! nguye nikwimba, \nK’listu niwami, Vulie!Vulie!", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_52, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3784, position: 2, content: "Chipwe milima yeza kufuka,\nMwe Chilamwina mangukwasa.\nIye lie Pangu kulichi kahwa,\nHamwe ni yami kumayaya", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_52, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3785, position: 3, content: "Pangu lipema lia kutemwina \nKu shimbo jami ndo ku mahio;\nMungunukaula hehi, Kafunga,\nVulie kumwaha ha ulamwino.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_52, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3786, position: 1, content: "Mbunge yami, panjika  \nKuli mwe Chilmwina;\nKanakuhula ngwenyi,\nMba unanguzange nyi?", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3787, content: "Funge nakutuswili, \nMweji nakuwukile;\nWatoka nawanyine,\nMeso nalawishile.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_53, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3788, position: 2, content: "Pwo mahichika mwana?\nE, mahasa, Yami ka;\nChichi kukwehukako,\nNdo mwilu munjilamo.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3789, position: 3, content: "Zango liami liahiana, \nKulichi Kwalumuka;\nLiakumba yuma yeswe,\nZango lia miaka yeswe,", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3790, position: 4, content: "Ku songo lia jila ye,\nMwilu mu uhenya pe;\nMukatwama ni Yami,\nMba unanguzange, nyi?", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_53, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3791, position: 1, content: "Ngulweze longeso lia Yesu, \nNgulweze vumbi lia K’listu \nNgumone mwe Chilamwina,\nZango lienyi, yangufwila.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_54, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3792, content: "Longeso lia Yesu,\nLongeso lia Yesu,\nNgumone mwe Chilamwina,\nZango lienyi, yangufwila.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_54, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3793, position: 2, content: "Longeso lia Yesu ngulweze,\nNgunyingikise kawape,\nSpilitu apwe longeshi,\nAlweze yuma ya Mwene.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_54, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3794, position: 3, content: "Longeso lia Yesu ku liji \nNgulishimwinye ni Mwene\nNi kwivwa liji lienyi pe, \nLikolo, mba ngulizuke.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_54, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3795, position: 4, content: "Longeso lia Yesu ha ngunja, \nUpite mwilu wahiana,\nLongeso lia wanangana.\nMeza kwiza ni uhenya,", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_54, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3796, position: 1, content: "Ku kuzanga cha mwe Tata\nMutuwaha,\nVumbi lienyi se chawana,\nTunawaha \nNi manyinga hatuwuka,\nMba ni vumbi twakuyuka,\nKwoko lienyi liatufuka,\nMutuwaha", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_55, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3797, position: 2, content: "Chipwe ndusu mu luyinda\nMutuwaha,\nSe ulamwino upema,\nTunawaha.\nNi chiseke tujamine,\nNi mihuko yinji twime,\nNi kutwama muli Mwene, \nMutuwaha.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_55, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3798, position: 3, content: "Tunatalatala Mwene,\nMutuwaha,\nMba nikufuliela twimbe,\nTunawaha.\nChe kuzanga chenyi kwivwa,\nNi yipema matuhoka,\nChipwe mwono, Chipwe kufwa,\nMutuwaha.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_55, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3799, position: 1, content: "Kusuku kanatwama mu milima,\nAkwa kutoka anji mu shili;\nMba iya maya ni kwaambulwila\nSango lia Yesu lia vumbi lienyi?", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_56, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3800, content: "“Chiyulo cheswe cha Yami,\nChiyulo cheswe cha Yami,\nYenu nwambujole lie \nSango Lipema\nMba hamwe ni yenu nguli”", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_56, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3801, position: 2, content: "Talenu, se mapito anji awashi, \nAkwa kufuliela, njilenumo;\nTwalenu kweswe Maliji a \nZambi,\nMukwatusula ku malenge jo.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_56, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3802, position: 3, content: "Chinenu kufwa, Zambi katambieka,\nChinenu kufwa, twambulwile eswe;\nYesu wafwile mukutulamwina,\nMwono wa ku miaka \ntwambujole.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_56, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3803, position: 4, content: "Lipupwisenu, tukamone tangwa,\nMuze mavungu eswe makemba;\nMakahetama ni kumulemesa,\nMwe Mwanangana, ngwo, Aleluya!", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_56, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3804, position: 1, content: "Hatangwa lize ashihile Yesu,\nChifuchi cheswe chalayile pwi,\nHa tangwa lize Yesu hahinduka\nPangu hilieza ku yifuchi yeswe", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_57, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3805, content: "Wahililenu, Tuwahililenu,\nTusakwilenu Mwene hakumba kufwa.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_57, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3806, position: 2, content: "Mapwo ayile nikutala fuka,\nKamuwanyine, hanatuhukamo,\nYahindukamo fuka yilimuhona,\nKufwa wachikumbile ni mwono.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_57, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3807, position: 3, content: "Akwa kulila, kanda nunenganyana,\nMukwa uhindukilo halumwesa mwono\nTumaji eswe yamutala meso,\nMwene yakumba ni uhindukilo.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_57, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3808, position: 1, content: "Kuli Yesu hiunayi kupema?\nKu manyinga unapeme, nyi?\nKuli Mwene wafuliela haliapwa?\nKu manyinga unapeme, nyi?", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3809, content: "Wapema, wapema,\nKu manyinga a Mwana-Panga?\nNi mazalo je apwa atoma to?\nKu manyinga unapeme, nyi?", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_58, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3810, position: 2, content: "Ni ku lumbu lienyi kuwakwenda nyi?\nKu manyinga unapeme, nyi?\nUnahwini muli mwe Chilamwina?\nKu manyinga unapeme, nyi?", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3811, position: 3, content: "Nyi Sandungi meza mukasamba, nyi?\nKu manyinga unapeme, nyi?\nMbunge muyipema ku meso jenyi?\nKu manyinga unapeme, nyi?", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3812, position: 4, content: "Zulako yipuzu ya luchisa we\nWa ku mbunge, mba mukapema;\nYesu kanakangana kulamwina,\nNi manyinga mwopwa mupema.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_58, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3813, position: 1, content: "Chizechene, nguneza te,\nKuli Yeus K’Listu Mwene,\nSe wangulakenya, ngwize,\nYena Mwana-panga wa Zambi", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3814, position: 2, content: "Chizechene, chashimbwile,\nMukulitomesa mbunge;\nAnguswile manyinga je,\nYena Mwana-panga wa Zambi.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3815, position: 3, content: "Chizechene, ngutambule,\nNgutomese, ngusambise,\nMumu nafuliela wate,\nYena Mwana-panga wa Zambi.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3816, position: 4, content: "Chizechene, haliapwila,\nKuli Yena, Mwana-panga\nYami nalitumbikila,\nYena Mwana-panga wa Zambi.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_59, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3817, position: 1, content: "Muze manga mungumona lamba\nMugushinginyeka kwiza che.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_60, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3818, content: "Haliapwa kumeza nawa,\nKwiza chenyi hichakundama;\nChichi kunenganyana,\nMwene kumangwijila.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_60, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3819, position: 2, content: "Kwali mwe Kasendo mupema,\nKechi kangu hichika.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_60, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3820, position: 3, content: "Yuma yeswe munguhichikayo,\nHanga ngukaule Yesu.", hymnsNumber: CoHymnsNumberSeeder.TUANUKE_60, typeStanza: HymnsContentCode.VERSE),
  ];
}